  input: '"TEXT","F3XN","C00034033","1.The SCGOP is using the following best effort
    to obtain identification of all individuals who contribute in excess of $200.  Our
    original solicitation includes a clear and conspicuous request for this information
    which includes the requirements of the federal law to provide such information.  If
    the information is not provided, we make a follow up effort per phone.  If the
    needed information is still not provided, we search the internet to obtain the
    information.  If we receive additional information we are either making an amendment
    for the period in question or add a memo stating the changes with our next filing.  2.
    No additional information which affect prior filings have been received.  3.  The
    disbursement on Schedule B, Line 21b for reimbursement for health insurance was
    to an employee who is NOT spending more than 25% of his time on Federal Election
    Activities. 4. The disbursement of $ 3252.22 to Starboard was for direct mail
    that did not promote, support, attack or oppose any candidate for Federal office
    and did not meet the definition of Federal Election Activity under 11 CFR 100.24.  5.
    The disbursement to Starboard for $ 8232.90 was for our annual reports, the disbursement
    for $ 3200 was for an invitation to the 2005 Legislative Reception.  These communications
    did not promote, support, attack or oppose any candidate for Federal office and
    did not meet the definition of Federal Election Activity under 11 CFR 100.24.
    6.  The disbursement to Applied Research Coordinates was for research for a federal
    congressional race.  7.  The disbursement to Feather Larson & Synthorst was for
    prospecting potential donors and did not meet the definition of Federal Election
    Activity under 11 CFR 100.24."'
